import React from "react";

export default function Synonyms(props) {
  if (props.synonyms) {
    return (
      <div>
        <p>
          <ul className="Synonyms">
            {props.synonyms.map(function (synonym, index) {
              return <li key={index}>{synonyms} </li>;
            })}
          </ul>
        </p>
      </div>
    );
  } else {
    return null;
  }
}
